import React from 'react';
import '../App.css';

export default function PanelShowData() {
  return (
    <Col lg="8" >
    <Row className='border border-dark p-2 '>

        <div className='rounded'>


        <Col lg="7" className='bg-primary'>

            <h1>Lista</h1>

        </Col>

        <Col lg="5" className='bg-danger'>

